import { useState } from "react";

export default function App() {
  const [currentView, setCurrentView] = useState("dashboard");
  const renderView = () => {
    switch (currentView) {
      case "dashboard":
        return <Dashboard />;

      default:
        return <div>Page not found</div>;
    }
    return <div>{renderView()}</div>;
  };

  function Dashboard() {
    return <p>Dashboard</p>;
  }
}
